INSERT INTO `questions` (`id`, `quiz_id`, `question_text`, `option_a`, `option_b`, `option_c`, `option_d`, `correct_option`, `explanation`) VALUES
(1, 'CVBGINQZ', 'What is the primary purpose of encryption in cybersecurity?', 'To prevent unauthorized access', 'To detect malware', 'To encrypt data during transmission', 'To authenticate users', 'C', 'Encryption ensures that data remains confidential and secure during transmission, preventing unauthorized access.'),
(2, 'CVBGINQZ', 'Which of the following is an example of a strong password?', '\"password\"', '\"123456\"', '\"P@55w0rd!\"', '\"username\"', 'C', 'A strong password combines uppercase, lowercase letters, numbers, and special characters, making it harder to crack.'),
(3, 'CVBGINQZ', 'What does the acronym \'HTTPS\' stand for?', 'HyperText Transfer Protocol Secure', 'HyperText Transfer Protocol Standard', 'HyperText Transmission Protocol Secure', 'HyperText Transfer Programming Secure', 'C', 'HTTPS stands for HyperText Transfer Protocol Secure, which ensures secure communication over a computer network.'),
(4, 'CVBGINQZ', 'What is the purpose of a firewall in cybersecurity?', 'To encrypt data', 'To monitor network traffic', 'To prevent physical access to a network', 'To filter incoming and outgoing network traffic', 'C', 'A firewall monitors and filters incoming and outgoing network traffic based on an organization\'s previously established security policies.'),
(5, 'CVBGINQZ', 'Which of the following is NOT an example of social engineering?', 'Phishing', 'Shoulder surfing', 'Installing antivirus software', 'Baiting', 'C', 'Installing antivirus software is a protective measure, not a social engineering tactic.'),
(6, 'CVBGINQZ', 'What is the main goal of malware?', 'To enhance computer performance', 'To protect against cyber attacks', 'To steal or damage data', 'To improve network security', 'C', 'The primary purpose of malware is to steal or damage data, causing harm to individuals or organizations.'),
(7, 'CVBGINQZ', 'What does the term \'two-factor authentication\' refer to?', 'Using two different internet browsers', 'Logging in with two different passwords', 'Providing two forms of authentication to access an account', 'Authenticating with a username and password simultaneously', 'C', 'Two-factor authentication enhances security by requiring two different forms of authentication, such as a password and a physical token.'),
(8, 'CVBGINQZ', 'Which of the following is NOT a common cybersecurity threat?', 'Ransomware', 'Spyware', 'Firewalls', 'Trojan horse', 'C', 'Firewalls are security measures, not threats. They help protect against threats like ransomware and spyware.'),
(9, 'CVBGINQZ', 'What is the first step in developing a cybersecurity strategy?', 'Installing antivirus software', 'Identifying assets and risks', 'Training employees on cybersecurity best practices', 'Implementing a firewall', 'C', 'The first step in developing a cybersecurity strategy is to identify assets and risks to better understand the threats that need to be mitigated.'),
(10, 'CVBGINQZ', 'What is the primary purpose of a VPN (Virtual Private Network)?', 'To protect against phishing attacks', 'To secure network traffic over public networks', 'To encrypt stored data', 'To prevent unauthorized access to physical devices', 'C', 'A VPN is used to secure network traffic over public networks, providing a private and secure connection.'),
(11, 'CVBGINQZ', 'What does the term \'phishing\' refer to in cybersecurity?', 'A method of encrypting data', 'A type of malware that steals passwords', 'An attempt to trick individuals into revealing sensitive information', 'A form of network intrusion detection', 'C', 'Phishing refers to deceptive attempts to obtain sensitive information by disguising as a trustworthy entity in electronic communications.'),
(12, 'CVBGINQZ', 'What is the purpose of a vulnerability assessment in cybersecurity?', 'To identify weaknesses in a system or network', 'To encrypt sensitive data', 'To authenticate users', 'To monitor network traffic', 'C', 'A vulnerability assessment identifies weaknesses in a system or network that could be exploited by attackers.'),
(13, 'CVBGINQZ', 'Which of the following is an example of a physical security measure?', 'Firewall', 'Antivirus software', 'Biometric access control', 'Encryption', 'C', 'Biometric access control, such as fingerprint or retina scans, is a physical security measure to restrict access to authorized individuals.'),
(14, 'CVBGINQZ', 'What is the main difference between symmetric and asymmetric encryption?', 'Symmetric encryption uses two different keys while asymmetric encryption uses one key.', 'Symmetric encryption is faster than asymmetric encryption.', 'Asymmetric encryption uses the same key for encryption and decryption.', 'Asymmetric encryption uses two different keys while symmetric encryption uses one key.', 'C', 'Asymmetric encryption uses a pair of keys (public and private), while symmetric encryption uses a single key for both encryption and decryption.'),
(15, 'CVBGINQZ', 'Which of the following is an example of a denial-of-service (DoS) attack?', 'Installing malware to steal credit card information', 'Brute-force password cracking', 'Flooding a network with excessive traffic to make it unavailable', 'Social engineering to obtain login credentials', 'C', 'A DoS attack involves overwhelming a network with excessive traffic, rendering it unavailable to users.'),
(16, 'CVBGINQZ', 'What does the term \'zero-day vulnerability\' refer to in cybersecurity?', 'A vulnerability that has been known for zero days', 'A vulnerability that has not yet been discovered by attackers', 'A vulnerability that has been exploited for zero days', 'A vulnerability that has been known for a long time', 'C', 'A zero-day vulnerability is a previously unknown vulnerability that attackers can exploit before the developer releases a fix.'),
(17, 'CVBGINQZ', 'What is the purpose of data backup in cybersecurity?', 'To prevent malware infections', 'To recover lost or corrupted data in case of an incident', 'To encrypt sensitive data', 'To authenticate users', 'C', 'Data backup is essential for recovering lost or corrupted data after an incident, ensuring business continuity.'),
(18, 'CVBGINQZ', 'What does the acronym \'IoT\' stand for in the context of cybersecurity?', 'Internet of Threats', 'Internet of Technology', 'Internet of Things', 'Information on Threats', 'C', 'IoT stands for Internet of Things, which refers to the network of physical objects embedded with sensors, software, and other technologies to connect and exchange data.'),
(19, 'CVBGINQZ', 'Which of the following is an example of a strong authentication factor?', 'Something you know', 'Something you are', 'Something you have', 'Something you like', 'C', 'A strong authentication factor is something you have, such as a security token, that adds an additional layer of security.'),
(20, 'CVBGINQZ', 'What is the purpose of security patches in cybersecurity?', 'To update antivirus software', 'To fix vulnerabilities and bugs in software', 'To encrypt data during transmission', 'To monitor network traffic', 'C', 'Security patches are updates provided by software vendors to fix vulnerabilities and bugs, improving the security of the software.'),
(21, 'CVBGOSQZ', 'What does OWASP stand for?', 'Open Web Application Security Protocol', 'Open Web Application Security Project', 'Online Web Application Security Protocol', 'Online Web Application Security Project', 'B', 'OWASP stands for Open Web Application Security Project.'),
(22, 'CVBGOSQZ', 'Which of the following is NOT part of the OWASP Top Ten?', 'Cross-Site Scripting (XSS)', 'SQL Injection', 'Distributed Denial of Service (DDoS)', 'Broken Authentication', 'C', 'Distributed Denial of Service (DDoS) is not part of the OWASP Top Ten.'),
(23, 'CVBGOSQZ', 'Which OWASP project is focused on improving software assurance processes?', 'OWASP ZAP', 'OWASP Juice Shop', 'OWASP SAMM', 'OWASP ASVS', 'C', 'OWASP SAMM focuses on improving software assurance processes.'),
(24, 'CVBGOSQZ', 'ASVS stands for:', 'Application Security Verification Standard', 'Application Security Validation System', 'Application Security Vulnerability Standard', 'Application Security Validation Standard', 'A', 'ASVS stands for Application Security Verification Standard.'),
(25, 'CVBGOSQZ', 'How many levels of verification does ASVS consist of?', '2', '3', '4', '5', 'B', 'ASVS consists of 3 levels of verification.'),
(26, 'CVBGOSQZ', 'Which level of ASVS includes advanced security requirements?', 'Level 1', 'Level 2', 'Level 3', 'Level 4', 'C', 'Level 3 of ASVS includes advanced security requirements.'),
(27, 'CVBGOSQZ', 'ASVS defines security controls in different categories. Which of the following is NOT a category in ASVS?', 'Authentication', 'Logging and Monitoring', 'Payment Card Industry Data Security Standard (PCI DSS) Compliance', 'Data Protection', 'C', 'Payment Card Industry Data Security Standard (PCI DSS) Compliance is not a category in ASVS.'),
(28, 'CVBGOSQZ', 'OWASP ZAP is primarily used for:', 'Authentication testing', 'Web application firewall', 'Penetration testing', 'Source code analysis', 'C', 'OWASP ZAP is primarily used for penetration testing.'),
(29, 'CVBGOSQZ', 'Which of the following is a common vulnerability addressed by ASVS?', 'Heartbleed', 'Shellshock', 'Cross-Site Scripting (XSS)', 'Poodle', 'C', 'Cross-Site Scripting (XSS) is a common vulnerability addressed by ASVS.'),
(30, 'CVBGOSQZ', 'Which OWASP project is a deliberately insecure web application?', 'OWASP ZAP', 'OWASP Juice Shop', 'OWASP ASVS', 'OWASP WebGoat', 'B', 'OWASP Juice Shop is a deliberately insecure web application.'),
(31, 'CVBGOSQZ', 'The OWASP Top Ten is primarily focused on:', 'Software development methodologies', 'Vulnerability management', 'Identifying common security risks in web applications', 'Network security protocols', 'C', 'The OWASP Top Ten is primarily focused on identifying common security risks in web applications.'),
(32, 'CVBGOSQZ', 'Which level of ASVS includes basic security requirements?', 'Level 1', 'Level 2', 'Level 3', 'Level 4', 'A', 'Level 1 of ASVS includes basic security requirements.'),
(33, 'CVBGOSQZ', 'OWASP SAMM is used for:', 'Secure application development', 'Security testing automation', 'Managing security incidents', 'Assessing security maturity', 'D', 'OWASP SAMM is used for assessing security maturity.'),
(34, 'CVBGOSQZ', 'Which of the following is a security control category in ASVS?', 'Web Hosting', 'Cross-Site Scripting', 'Data Center Management', 'Access Control', 'D', 'Access Control is a security control category in ASVS.'),
(35, 'CVBGOSQZ', 'What is the main purpose of OWASP?', 'To develop web application frameworks', 'To promote web application security best practices', 'To provide web hosting services', 'To enforce web application regulations and compliance standards', 'B', 'The main purpose of OWASP is to promote web application security best practices.'),
(36, 'CVBGNSQZ', 'Which of the following network security devices acts as a barrier between a trusted internal network and untrusted external networks?', 'Intrusion Detection System (IDS)', 'Virtual Private Network (VPN)', 'Firewall', 'Secure Socket Layer (SSL)', 'C', 'A firewall acts as a barrier between a trusted internal network and untrusted external networks by monitoring and controlling incoming and outgoing network traffic based on predetermined security rules.'),
(37, 'CVBGNSQZ', 'Which encryption protocol is commonly used to secure data transmitted over the internet such as web traffic?', 'AES (Advanced Encryption Standard)', 'RSA (Rivest-Shamir-Adleman)', 'SSL/TLS', 'SHA (Secure Hash Algorithm)', 'C', 'SSL/TLS (Secure Socket Layer/Transport Layer Security) is the encryption protocol commonly used to secure data transmitted over the internet, ensuring the privacy and data integrity between the server and the client.'),
(38, 'CVBGNSQZ', 'Which network security protocol provides secure remote access to private networks over the internet?', 'SSL/TLS', 'SSH', 'IPSec', 'RADIUS', 'C', 'IPSec (Internet Protocol Security) provides secure remote access to private networks over the internet by authenticating and encrypting each IP packet in a communication session.'),
(39, 'CVBGNSQZ', 'Which type of testing involves simulating real-world cyberattacks to identify and exploit security vulnerabilities?', 'Vulnerability Assessment', 'Penetration Testing', 'Security Code Review', 'Social Engineering Testing', 'B', 'Penetration Testing involves simulating real-world cyberattacks to identify and exploit security vulnerabilities in a system, application, or network.'),
(40, 'CVBGNSQZ', 'What type of testing focuses on assessing the security of wireless networks including Wi-Fi networks and Bluetooth?', 'Wireless Security Testing', 'Network Security Testing', 'Web Application Security Testing', 'Red Team vs. Blue Team Exercises', 'A', 'Wireless Security Testing focuses on assessing the security of wireless networks, including Wi-Fi networks and Bluetooth, to identify potential vulnerabilities.'),
(41, 'CVBGNSQZ', 'Which security control is used to control network traffic by permitting or denying packets based on criteria such as source IP address and destination port number?', 'Intrusion Prevention System (IPS)', 'Access Control Lists (ACLs)', 'Security Information and Event Management (SIEM)', 'Virtual Private Network (VPN)', 'B', 'Access Control Lists (ACLs) are security controls used to control network traffic by permitting or denying packets based on criteria such as source IP address and destination port number.'),
(42, 'CVBGNSQZ', 'Which web application vulnerability involves injecting malicious SQL code into input fields to manipulate database queries?', 'Cross-Site Scripting (XSS)', 'Cross-Site Request Forgery (CSRF)', 'SQL Injection', 'Clickjacking', 'C', 'SQL Injection is a web application vulnerability that involves injecting malicious SQL code into input fields to manipulate database queries and gain unauthorized access to the database.'),
(43, 'CVBGNSQZ', 'What type of testing involves manually reviewing the source code of applications to identify security flaws and vulnerabilities?', 'Vulnerability Assessment', 'Penetration Testing', 'Security Code Review', 'Social Engineering Testing', 'C', 'Security Code Review involves manually reviewing the source code of applications to identify security flaws and vulnerabilities, ensuring that the code adheres to security best practices.'),
(44, 'CVBGNSQZ', 'Which authentication protocol is commonly used for centralized authentication and authorization?', 'SSL/TLS', 'SSH', 'RADIUS', 'IPSec', 'C', 'RADIUS (Remote Authentication Dial-In User Service) is an authentication protocol commonly used for centralized authentication and authorization, allowing users to connect to a network service.'),
(45, 'CVBGNSQZ', 'What is the primary purpose of an Intrusion Detection System (IDS)?', 'To encrypt data transmitted over the network', 'To prevent unauthorized access to the network', 'To monitor network traffic for suspicious activity', 'To authenticate users before granting access to the network', 'C', 'The primary purpose of an Intrusion Detection System (IDS) is to monitor network traffic for suspicious activity and potential threats, alerting administrators to possible security breaches.'),
(46, 'CVBGNSQZ', 'Which protocol is used to create encrypted tunnels between a user\'s device and a VPN server?', 'IPSec', 'SSH', 'SSL/TLS', 'OpenVPN', 'D', 'OpenVPN is a protocol used to create encrypted tunnels between a user\'s device and a VPN server, providing secure access to the internet and ensuring data privacy.'),
(47, 'CVBGNSQZ', 'Which type of testing assesses the effectiveness of security awareness training by simulating social engineering attacks?', 'Vulnerability Assessment', 'Penetration Testing', 'Security Code Review', 'Social Engineering Testing', 'D', 'Social Engineering Testing assesses the effectiveness of security awareness training by simulating social engineering attacks, testing how well employees can identify and respond to such threats.'),
(48, 'CVBGNSQZ', 'Which security measure is used to translate private IP addresses into public IP addresses and vice versa?', 'Intrusion Prevention System (IPS)', 'Network Address Translation (NAT)', 'Access Control Lists (ACLs)', 'Security Information and Event Management (SIEM)', 'B', 'Network Address Translation (NAT) is a security measure used to translate private IP addresses into public IP addresses and vice versa, allowing multiple devices on a local network to share a single public IP address.'),
(49, 'CVBGNSQZ', 'Which web application vulnerability allows an attacker to trick a user into clicking on a malicious link that performs unauthorized actions?', 'Cross-Site Scripting (XSS)', 'Cross-Site Request Forgery (CSRF)', 'SQL Injection', 'Clickjacking', 'D', 'Clickjacking is a web application vulnerability that allows an attacker to trick a user into clicking on a malicious link that performs unauthorized actions without the user\'s knowledge.'),
(50, 'CVBGNSQZ', 'Which security control is responsible for collecting analyzing and correlating security events from various sources across the network?', 'Intrusion Detection System (IDS)', 'Virtual Private Network (VPN)', 'Security Information and Event Management (SIEM)', 'Access Control Lists (ACLs)', 'C', 'Security Information and Event Management (SIEM) is a security control responsible for collecting, analyzing, and correlating security events from various sources across the network to detect and respond to potential threats.'),
(51, 'CVBGNSQZ', 'Which protocol is commonly used to securely transfer files over a network?', 'SMTP', 'FTP', 'SSH', 'SNMP', 'C', 'SSH (Secure Shell) is a protocol commonly used to securely transfer files over a network, providing strong encryption and secure communication channels.'),
(52, 'CVBGPTQZ', 'What is Penetration Testing?', 'A type of vulnerability assessment', 'An automated process to secure networks', 'Simulating real-world cyberattacks to identify and exploit security vulnerabilities', 'Testing network speed and bandwidth', 'C', 'Penetration testing involves simulating real-world cyberattacks to identify and exploit security vulnerabilities in systems, networks, and applications.'),
(53, 'CVBGPTQZ', 'Which of the following best describes the goal of penetration testing?', 'To detect all vulnerabilities in a network', 'To simulate real-world cyberattacks', 'To guarantee 100% security', 'To replace regular security audits', 'B', 'The goal of penetration testing is to simulate real-world cyberattacks to identify and exploit security vulnerabilities, thereby assessing the security posture of the system.'),
(54, 'CVBGPTQZ', 'Which penetration testing methodology focuses on gathering information about the target system before launching attacks?', 'Enumeration', 'Exploitation', 'Reconnaissance', 'Post-Exploitation', 'C', 'Reconnaissance is the methodology that focuses on gathering information about the target system before launching attacks, helping in the planning of the attack strategy.'),
(55, 'CVBGPTQZ', 'Which tool is commonly used for network reconnaissance and information gathering during penetration testing?', 'Metasploit', 'Wireshark', 'Nmap', 'John the Ripper', 'C', 'Nmap is commonly used for network reconnaissance and information gathering during penetration testing, helping in discovering hosts and services on a computer network.'),
(56, 'CVBGPTQZ', 'In penetration testing what is the purpose of exploitation?', 'To gather information about the target system', 'To gain unauthorized access to the target system', 'To analyze network traffic', 'To identify vulnerabilities in web applications', 'B', 'The purpose of exploitation in penetration testing is to gain unauthorized access to the target system, demonstrating the impact of the identified vulnerabilities.'),
(57, 'CVBGPTQZ', 'Which type of penetration testing involves testing the security of web applications for vulnerabilities such as SQL injection and cross-site scripting (XSS)?', 'Network penetration testing', 'Wireless penetration testing', 'Web application penetration testing', 'Social engineering penetration testing', 'C', 'Web application penetration testing focuses on testing the security of web applications for vulnerabilities such as SQL injection and cross-site scripting (XSS).'),
(58, 'CVBGPTQZ', 'What is the primary goal of post-exploitation in penetration testing?', 'To gather evidence of successful exploitation', 'To launch additional attacks on the target system', 'To report vulnerabilities to the system owner', 'To delete all traces of the penetration test', 'A', 'The primary goal of post-exploitation in penetration testing is to gather evidence of successful exploitation and understand the impact of the breach on the target system.'),
(59, 'CVBGPTQZ', 'Which tool is commonly used for password cracking during penetration testing?', 'Wireshark', 'John the Ripper', 'Nessus', 'Burp Suite', 'B', 'John the Ripper is a tool commonly used for password cracking during penetration testing, helping to test the strength of passwords.'),
(60, 'CVBGPTQZ', 'What is the main difference between vulnerability scanning and penetration testing?', 'Vulnerability scanning requires human intervention while penetration testing is fully automated.', 'Penetration testing involves exploiting vulnerabilities to assess their impact while vulnerability scanning only identifies vulnerabilities.', 'Vulnerability scanning is more comprehensive than penetration testing.', 'Penetration testing is performed by software tools while vulnerability scanning is performed by security experts.', 'B', 'The main difference is that penetration testing involves exploiting vulnerabilities to assess their impact, while vulnerability scanning only identifies vulnerabilities without exploiting them.'),
(61, 'CVBGPTQZ', 'Which phase of penetration testing involves documenting findings potential impact and recommendations for remediation?', 'Reconnaissance', 'Exploitation', 'Reporting', 'Post-Exploitation', 'C', 'The reporting phase of penetration testing involves documenting findings, potential impact, and recommendations for remediation to help improve the security posture of the target system.'),
(62, 'CVBGPTQZ', 'Which of the following is an example of an active reconnaissance technique in penetration testing?', 'Monitoring network traffic', 'Sending probe packets to target hosts', 'Analyzing public information sources', 'Social engineering attacks', 'B', 'Active reconnaissance techniques in penetration testing, such as sending probe packets to target hosts, involve direct interaction with the target system to gather information.'),
(63, 'CVBGPTQZ', 'During a penetration test what is the purpose of the \'black box\' approach?', 'The tester has full knowledge of the target system\'s architecture and configuration.', 'The tester has no prior knowledge of the target system and simulates an external attacker.', 'The tester collaborates closely with the system administrators to identify vulnerabilities.', 'The tester focuses solely on identifying vulnerabilities in web applications.', 'B', 'The \'black box\' approach in penetration testing involves the tester having no prior knowledge of the target system, simulating an external attacker.'),
(64, 'CVBGPTQZ', 'Which tool is commonly used for exploiting vulnerabilities and gaining unauthorized access during penetration testing?', 'Nessus', 'Metasploit', 'Wireshark', 'Nmap', 'B', 'Metasploit is a tool commonly used for exploiting vulnerabilities and gaining unauthorized access during penetration testing, providing a framework for developing and executing exploits.'),
(65, 'CVBGPTQZ', 'What is the primary goal of a penetration tester during the exploitation phase?', 'To gather information about the target system', 'To launch additional attacks on the network', 'To gain unauthorized access to the target system', 'To generate a detailed report of vulnerabilities', 'C', 'The primary goal of a penetration tester during the exploitation phase is to gain unauthorized access to the target system, demonstrating the potential impact of the vulnerabilities.'),
(66, 'CVBGPTQZ', 'In penetration testing what is the purpose of a \'pivot\' or \'pivot point\'?', 'To launch attacks on multiple targets simultaneously', 'To redirect network traffic through a compromised system to attack other systems', 'To gather information about potential vulnerabilities in the network', 'To evade detection by security monitoring systems', 'B', 'In penetration testing, a \'pivot\' or \'pivot point\' involves redirecting network traffic through a compromised system to attack other systems, helping in extending the reach of the attack.'),
(67, 'CVBGPTQZ', 'Which phase of penetration testing involves verifying whether vulnerabilities have been successfully mitigated after remediation actions have been taken?', 'Reconnaissance', 'Exploitation', 'Reporting', 'Validation', 'D', 'The validation phase of penetration testing involves verifying whether vulnerabilities have been successfully mitigated after remediation actions have been taken, ensuring the effectiveness of the remediation efforts.'),
(68, 'CVBGWSQZ', 'What does XSS stand for in the context of web security?', 'External Security System', 'Extended Security Service', 'Cross-Site Scripting', 'Extended Session Security', 'C', 'XSS stands for Cross-Site Scripting, a type of security vulnerability typically found in web applications.'),
(69, 'CVBGWSQZ', 'Which of the following is a common mitigation strategy against SQL injection attacks?', 'Regularly updating server hardware', 'Using HTTPS for all web traffic', 'Implementing input validation and parameterized queries', 'Increasing server bandwidth', 'C', 'Implementing input validation and parameterized queries is a common strategy to mitigate SQL injection attacks.'),
(70, 'CVBGWSQZ', 'What type of attack involves an attacker tricking users into performing unintended actions?', 'Cross-Site Scripting (XSS)', 'Cross-Site Request Forgery (CSRF)', 'SQL Injection', 'Man-in-the-Middle (MitM)', 'B', 'Cross-Site Request Forgery (CSRF) involves an attacker tricking users into performing unintended actions.'),
(71, 'CVBGWSQZ', 'Which security principle involves ensuring that data is not tampered with during transmission or storage?', 'Confidentiality', 'Integrity', 'Authentication', 'Authorization', 'B', 'Integrity involves ensuring that data is not tampered with during transmission or storage.'),
(72, 'CVBGWSQZ', 'What is the primary purpose of using HTTPS?', 'Ensuring availability of web services', 'Encrypting data in transit', 'Preventing XSS attacks', 'Validating user inputs', 'B', 'The primary purpose of using HTTPS is to encrypt data in transit, ensuring secure communication over the web.'),
(73, 'CVBGWSQZ', 'How can session hijacking be mitigated?', 'By using strong passwords', 'By implementing multi-factor authentication', 'By using secure session management and tokens', 'By increasing server processing power', 'C', 'Session hijacking can be mitigated by using secure session management and tokens to maintain session integrity.'),
(74, 'CVBGWSQZ', 'What is a common technique used in phishing attacks?', 'Injecting malicious scripts into web pages', 'Intercepting communication between two parties', 'Tricking users into providing sensitive information', 'Overloading a system with traffic', 'C', 'A common technique in phishing attacks is tricking users into providing sensitive information through deceptive means.'),
(75, 'CVBGWSQZ', 'Which security header helps prevent XSS attacks by specifying approved sources for content?', 'Content Security Policy (CSP)', 'Strict-Transport-Security (HSTS)', 'X-XSS-Protection', 'X-Frame-Options', 'A', 'Content Security Policy (CSP) helps prevent XSS attacks by specifying approved sources for content.'),
(76, 'CVBGWSQZ', 'What is a common method for mitigating brute force attacks?', 'Implementing CAPTCHA challenges', 'Using HTTPS for all web traffic', 'Regularly updating server hardware', 'Encrypting data at rest', 'A', 'Implementing CAPTCHA challenges is a common method to mitigate brute force attacks by ensuring the entity accessing the system is human.'),
(77, 'CVBGWSQZ', 'What is the purpose of conducting regular security audits and penetration tests?', 'To ensure the availability of web services', 'To identify and mitigate potential security vulnerabilities', 'To encrypt data in transit', 'To prevent CSRF attacks', 'B', 'Regular security audits and penetration tests are conducted to identify and mitigate potential security vulnerabilities.'),
(78, 'CVBGKLQZ', 'What is a keylogger?', 'A hardware device used for gaming', 'A software program that records keystrokes', 'A tool for encrypting sensitive data', 'A type of computer virus', 'B', 'A keylogger is a software program that records keystrokes to capture sensitive information.'),
(79, 'CVBGKLQZ', 'How do hardware keyloggers differ from software keyloggers?', 'Hardware keyloggers require physical installation while software keyloggers are installed remotely.', 'Hardware keyloggers are more difficult to detect than software keyloggers.', 'Hardware keyloggers record only keystrokes while software keyloggers can capture other activities.', 'Both a) and b)', 'D', 'Hardware keyloggers require physical installation and are more difficult to detect, while software keyloggers can be installed remotely.'),
(80, 'CVBGKLQZ', 'Which of the following is a legitimate use of keyloggers?', 'Monitoring employee activities without their consent', 'Logging keystrokes to prevent data loss', 'Stealing passwords for malicious purposes', 'Recording personal conversations', 'B', 'Legitimate use of keyloggers includes logging keystrokes to prevent data loss.'),
(81, 'CVBGKLQZ', 'How can users protect themselves from keyloggers?', 'Avoiding downloading files from unknown sources', 'Keeping antivirus software up to date', 'Using virtual keyboards for sensitive data entry', 'All of the above', 'D', 'Users can protect themselves by avoiding downloading files from unknown sources, keeping antivirus software up to date, and using virtual keyboards.'),
(82, 'CVBGKLQZ', 'What type of keylogger operates by intercepting system calls to record keystrokes?', 'Hardware keylogger', 'Software keylogger', 'Kernel-based keylogger', 'Wireless keylogger', 'C', 'Kernel-based keyloggers operate by intercepting system calls to record keystrokes.'),
(83, 'CVBGKLQZ', 'Which of the following is a symptom of a keylogger infection?', 'Random pop-up advertisements', 'Unusual network activity', 'Sluggish computer performance', 'All of the above', 'D', 'Symptoms of keylogger infection include random pop-up advertisements, unusual network activity, and sluggish computer performance.'),
(84, 'CVBGKLQZ', 'Which programming language is commonly used to create keyloggers?', 'Java', 'Python', 'C++', 'HTML', 'C', 'C++ is a commonly used programming language to create keyloggers.'),
(85, 'CVBGKLQZ', 'What is a common method for distributing keyloggers?', 'Email attachments', 'Social media posts', 'USB drives', 'All of the above', 'D', 'Common methods for distributing keyloggers include email attachments, social media posts, and USB drives.'),
(86, 'CVBGKLQZ', 'Which type of keylogger is typically considered the most difficult to detect?', 'Hardware keylogger', 'Software keylogger', 'Kernel-based keylogger', 'Remote access keylogger', 'A', 'Hardware keyloggers are typically considered the most difficult to detect due to their physical nature.'),
(87, 'CVBGKLQZ', 'What legal implications are associated with using keyloggers?', 'It is legal to use keyloggers on personal devices.', 'It is legal to use keyloggers on company-owned devices without consent.', 'It is illegal to use keyloggers to monitor someone\'s activities without their consent.', 'Keyloggers are always illegal to use under any circumstance.', 'C', 'It is illegal to use keyloggers to monitor someone\'s activities without their consent.'),
(88, 'CVBGOSQZ', 'What does CAPTCHA stand for?', 'Computerized Automated Program to Test Human Accuracy', 'Completely Automated Public Turing test to tell Computers and Humans Apart', 'Computer Analysis Program for Tracking Human Activities', 'Cybernetic Authentication Process to Test Human Aptitude', 'B', 'CAPTCHA stands for Completely Automated Public Turing test to tell Computers and Humans Apart.'),
(89, 'CVBGOSQZ', 'Which of the following is NOT a type of CAPTCHA?', 'Text-Based CAPTCHA', 'Image-Based CAPTCHA', 'Video-Based CAPTCHA', 'Checkbox CAPTCHA', 'C', 'Video-Based CAPTCHA is not a commonly used type of CAPTCHA.'),
(90, 'CVBGOSQZ', 'What is the purpose of CAPTCHA?', 'To identify human users on a website', 'To prevent automated bots from accessing a website', 'To collect user data for marketing purposes', 'To improve website accessibility for users with disabilities', 'B', 'The purpose of CAPTCHA is to prevent automated bots from accessing a website.'),
(91, 'CVBGOSQZ', 'Which CAPTCHA type requires users to solve a mathematical equation?', 'Text-Based CAPTCHA', 'Image-Based CAPTCHA', 'Mathematical CAPTCHA', 'Checkbox CAPTCHA', 'C', 'Mathematical CAPTCHA requires users to solve a mathematical equation.'),
(92, 'CVBGOSQZ', 'Which CAPTCHA type is specifically designed for users with visual impairments?', 'Text-Based CAPTCHA', 'Image-Based CAPTCHA', 'Mathematical CAPTCHA', 'Audio CAPTCHA', 'D', 'Audio CAPTCHA is specifically designed for users with visual impairments.'),
(93, 'CVBGOSQZ', 'Which CAPTCHA type asks users to check a box to confirm they are not a robot?', 'Checkbox CAPTCHA', 'Slider CAPTCHA', 'Text-Based CAPTCHA', 'Audio CAPTCHA', 'A', 'Checkbox CAPTCHA asks users to check a box to confirm they are not a robot.'),
(94, 'CVBGOSQZ', 'What is one challenge associated with CAPTCHA?', 'Usability issues for users with disabilities', 'Limited effectiveness against advanced bots', 'Lack of available CAPTCHA types', 'High cost of implementation', 'A', 'Usability issues for users with disabilities are one of the challenges associated with CAPTCHA.'),
(95, 'CVBGOSQZ', 'Which CAPTCHA method relies on behavioral analysis to distinguish between human and bot behavior?', 'Text-Based CAPTCHA', 'Image-Based CAPTCHA', 'Checkbox CAPTCHA', 'Slider CAPTCHA', 'D', 'Slider CAPTCHA relies on behavioral analysis to distinguish between human and bot behavior.'),
(96, 'CVBGOSQZ', 'Which CAPTCHA version does not require any user interaction?', 'ReCAPTCHA v1', 'ReCAPTCHA v2', 'ReCAPTCHA v3', 'ReCAPTCHA v4', 'C', 'ReCAPTCHA v3 does not require any user interaction.'),
(97, 'CVBGOSQZ', 'What is an essential consideration when implementing CAPTCHA?', 'Maximizing website performance', 'Providing alternative options for users with disabilities', 'Increasing the number of CAPTCHA challenges', 'Reducing website security measures', 'B', 'Providing alternative options for users with disabilities is essential when implementing CAPTCHA.'),
(98, 'CVBGWGQZ', 'What is WebGoat?', 'A species of goat found in the wild', 'An open-source web application designed for security testing', 'A web browser developed by Google', 'A programming language commonly used for web development', 'B', 'WebGoat is an open-source web application designed for security testing.'),
(99, 'CVBGWGQZ', 'Which of the following is a recommended step to prepare for the hands-on session with WebGoat?', 'Reviewing basic security concepts', 'Memorizing error messages', 'Ignoring installation requirements', 'Skipping exploration of OWASP ZAP', 'A', 'Reviewing basic security concepts is a recommended step to prepare for the hands-on session with WebGoat.'),
(100, 'CVBGWGQZ', 'What is OWASP ZAP?', 'A type of animal commonly found in the ocean', 'A dynamic analysis tool for web application security testing', 'An operating system used for web development', 'A programming language for building mobile applications', 'B', 'OWASP ZAP is a dynamic analysis tool for web application security testing.'),
(101, 'CVBGWGQZ', 'Why is it important to set up a development environment before the hands-on session?', 'To practice basic operations within WebGoat', 'To skip exploring OWASP ZAP', 'To increase the chances of encountering issues during the session', 'To avoid installing necessary software', 'A', 'Setting up a development environment before the hands-on session is important to practice basic operations within WebGoat.'),
(102, 'CVBGWGQZ', 'Which of the following is a common web vulnerability?', 'Secure Socket Layer (SSL)', 'Cross-Site Scripting (XSS)', 'Hypertext Markup Language (HTML)', 'Internet Protocol (IP)', 'B', 'Cross-Site Scripting (XSS) is a common web vulnerability.'),
(103, 'CVBGWGQZ', 'What should students do if they encounter issues during the installation or hands-on session?', 'Give up and stop trying', 'Consult documentation and seek assistance', 'Ignore the issues and continue', 'Assume the issues will resolve themselves', 'B', 'If students encounter issues during the installation or hands-on session, they should consult documentation and seek assistance.'),
(104, 'CVBGWGQZ', 'What is the purpose of documenting the installation and scan process?', 'To increase confusion', 'To provide valuable reference material', 'To prevent others from understanding the process', 'To waste time', 'B', 'The purpose of documenting the installation and scan process is to provide valuable reference material.'),
(105, 'CVBGWGQZ', 'What ethical consideration should be kept in mind when performing security assessments on web applications?', 'Obtaining proper authorization', 'Ignoring privacy concerns', 'Exploiting vulnerabilities without permission', 'Disregarding integrity of the target system', 'A', 'When performing security assessments on web applications, it is important to obtain proper authorization.'),
(106, 'CVBGGHQZ', 'What is GitHub primarily used for?', 'Social networking', 'Version control and collaboration', 'Online shopping', 'Video streaming', 'B', 'GitHub is widely used for version control and collaborative development of software projects.'),
(107, 'CVBGGHQZ', 'Which version control system is utilized by GitHub?', 'Subversion (SVN)', 'Mercurial', 'Git', 'CVS (Concurrent Versions System)', 'C', 'GitHub is a platform built around Git, which is a distributed version control system.'),
(108, 'CVBGGHQZ', 'What is a repository in the context of GitHub?', 'A place to store physical documents', 'A collection of database tables', 'A container for project code and related files', 'A folder on your local computer', 'C', 'A repository on GitHub stores project files, including code, documentation, and other resources.'),
(109, 'CVBGGHQZ', 'What are branches used for in Git and GitHub?', 'To merge unrelated projects', 'To organize files within a repository', 'To track changes to files', 'To work on independent lines of development', 'D', 'Branches allow developers to work on different features or fixes independently before merging them into the main codebase.'),
(110, 'CVBGGHQZ', 'What is the purpose of a pull request (PR) in GitHub?', 'To request assistance from GitHub support', 'To propose merging changes from one branch into another', 'To create a new repository', 'To report a bug in the code', 'B', 'Pull requests facilitate the review and merging of changes between branches.'),
(111, 'CVBGGHQZ', 'Which GitHub feature is commonly used to track bugs, feature requests, and other tasks related to a project?', 'Issues', 'Pull requests', 'Forks', 'Branches', 'A', 'The Issues feature is used to track and manage bugs, enhancements, and other project tasks.'),
(112, 'CVBGGHQZ', 'What does forking a repository mean in GitHub?', 'Creating a copy of the original repository in your GitHub account', 'Deleting a repository', 'Merging two repositories together', 'Renaming a repository', 'A', 'Forking creates a personal copy of someone else\'s repository, allowing you to experiment without affecting the original project.'),
(113, 'CVBGGHQZ', 'How can collaborators contribute to a GitHub repository?', 'By sending emails to the repository owner', 'By making changes directly to the main branch', 'By opening pull requests and proposing changes', 'By downloading a copy of the repository', 'C', 'Collaborators suggest changes through pull requests, which can be reviewed and merged by the repository owner.'),
(114, 'CVBGGHQZ', 'Which Git command is used to upload local changes to a remote repository on GitHub?', 'git checkout', 'git push', 'git commit', 'git pull', 'B', 'The git push command uploads local repository content to a remote repository.'),
(115, 'CVBGGHQZ', 'What are some benefits of using GitHub for project management?', 'Facilitates communication and code review', 'Tracks changes to files over time', 'Provides opportunities for community engagement', 'All of the above', 'D', 'GitHub facilitates communication, code review, tracks changes, and engages the community, making it a robust tool for project management.'),
(116, 'CVBGSIQZ', 'What is SQL injection?', 'A method for encrypting sensitive data in a database.', 'A technique for optimizing database performance.', 'An attack that involves injecting malicious SQL commands into an application\'s input fields.', 'A strategy for preventing unauthorized access to a database.', 'C', 'SQL injection is an attack that involves injecting malicious SQL commands into an application\'s input fields, compromising the security of the database.'),
(117, 'CVBGSIQZ', 'Which of the following statements best describes a SQL injection vulnerability?', 'It occurs when a database server is overwhelmed with too many requests.', 'It allows attackers to manipulate the database by injecting malicious SQL code through input fields.', 'It involves encrypting sensitive data stored in a database.', 'It is a technique used to improve the speed of database queries.', 'B', 'A SQL injection vulnerability allows attackers to manipulate the database by injecting malicious SQL code through input fields, leading to potential data breaches.'),
(118, 'CVBGSIQZ', 'How can SQL injection vulnerabilities be exploited?', 'By brute force attacks on database passwords.', 'By injecting malicious SQL code into input fields of a web application.', 'By encrypting sensitive data stored in a database.', 'By implementing strong firewall rules.', 'B', 'SQL injection vulnerabilities can be exploited by injecting malicious SQL code into input fields of a web application, enabling unauthorized access to the database.'),
(119, 'CVBGSIQZ', 'Which of the following is a potential consequence of a successful SQL injection attack?', 'Improving database performance.', 'Encrypting sensitive data.', 'Manipulating or deleting database records.', 'Enhancing application security.', 'C', 'A successful SQL injection attack can lead to manipulating or deleting database records, causing significant damage to the integrity and availability of data.'),
(120, 'CVBGSIQZ', 'What is the purpose of SQLmap?', 'To optimize SQL queries for better performance.', 'To automate the process of detecting and exploiting SQL injection vulnerabilities.', 'To encrypt sensitive data stored in a database.', 'To prevent unauthorized access to a database.', 'B', 'SQLmap is a tool used to automate the process of detecting and exploiting SQL injection vulnerabilities, helping security professionals identify and fix such issues.'),
(121, 'CVBGSIQZ', 'What precaution should developers take to prevent SQL injection attacks?', 'Implementing input validation and parameterized queries.', 'Increasing database server resources.', 'Encrypting all data stored in the database.', 'Disabling error messages in the web application.', 'A', 'To prevent SQL injection attacks, developers should implement input validation and parameterized queries, which help sanitize inputs and prevent malicious code execution.'),
(122, 'CVBGSIQZ', 'Which type of SQL injection attack involves modifying the structure of SQL queries?', 'Time-based SQL injection.', 'Error-based SQL injection.', 'Union-based SQL injection.', 'Blind SQL injection.', 'C', 'Union-based SQL injection involves modifying the structure of SQL queries to combine the results of two or more queries, exploiting the UNION SQL operator.'),
(123, 'CVBGSIQZ', 'How does a UNION-based SQL injection attack work?', 'By exploiting errors returned by the database server.', 'By injecting a malicious SQL query that retrieves data from multiple tables.', 'By delaying the server\'s response to determine if a condition is true or false.', 'By brute forcing the password of the database.', 'B', 'A UNION-based SQL injection attack works by injecting a malicious SQL query that retrieves data from multiple tables, exploiting the UNION SQL operator.'),
(124, 'CVBGSIQZ', 'Which of the following is a common defense mechanism against SQL injection attacks?', 'Implementing input validation and sanitization.', 'Increasing the complexity of database passwords.', 'Encrypting all data stored in the database.', 'Disabling the database\'s error reporting.', 'A', 'Common defense mechanisms against SQL injection attacks include implementing input validation and sanitization, which help ensure that input data is safe and valid.'),
(125, 'CVBGSIQZ', 'What is the ethical way to use SQL injection testing tools like SQLmap?', 'To target any website without permission to assess its security.', 'To automate the process of detecting and exploiting SQL injection vulnerabilities on authorized systems.', 'To cause disruption or damage to vulnerable systems for personal gain.', 'To share sensitive information obtained from unauthorized access with unauthorized parties.', 'B', 'The ethical way to use SQL injection testing tools like SQLmap is to automate the process of detecting and exploiting SQL injection vulnerabilities on authorized systems.'),
(126, 'CVBGDDQZ', 'What does DoS stand for in the context of cyber-attacks?', 'Denial of Security', 'Distributed System', 'Denial of Service', 'Digital Operation System', 'C', 'DoS stands for Denial of Service, which is an attack meant to shut down a machine or network, making it inaccessible to its intended users.'),
(127, 'CVBGDDQZ', 'Which of the following is NOT a characteristic of a DDoS attack?', 'Involves multiple compromised systems', 'Uses a single attacking system', 'Intended to overwhelm a target system', 'Aims to disrupt normal service', 'B', 'A DDoS attack involves multiple compromised systems, not a single attacking system, to overwhelm a target system.'),
(128, 'CVBGDDQZ', 'What is the primary difference between DoS and DDoS attacks?', 'DoS attacks involve multiple attackers while DDoS attacks involve a single attacker.', 'DoS attacks are less harmful than DDoS attacks.', 'DoS attacks involve a single attacking system while DDoS attacks involve multiple systems.', 'DoS attacks target software vulnerabilities while DDoS attacks target network infrastructure.', 'C', 'The primary difference between DoS and DDoS attacks is that DoS involves a single attacking system while DDoS involves multiple systems.'),
(129, 'CVBGDDQZ', 'Which of the following is a common motive behind launching DDoS attacks?', 'Financial gain', 'Political activism', 'Competitive advantage', 'All of the above', 'D', 'DDoS attacks can be launched for various motives including financial gain, political activism, and competitive advantage.'),
(130, 'CVBGDDQZ', 'Which of the following is NOT a type of DDoS attack?', 'SYN Flood', 'Ping of Death', 'Smurf Attack', 'Trojan Horse', 'D', 'Trojan Horse is not a type of DDoS attack. DDoS attacks include SYN Flood, Ping of Death, and Smurf Attack.'),
(131, 'CVBGDDQZ', 'What is the main purpose of a DDoS attack?', 'To steal sensitive information', 'To gain unauthorized access to a system', 'To disrupt the normal functioning of a service', 'To deface a website', 'C', 'The main purpose of a DDoS attack is to disrupt the normal functioning of a service, making it unavailable to users.'),
(132, 'CVBGDDQZ', 'Which of the following is a countermeasure against DDoS attacks?', 'Intrusion Detection System (IDS)', 'Firewalls', 'Load Balancers', 'All of the above', 'D', 'Countermeasures against DDoS attacks include using Intrusion Detection Systems (IDS), Firewalls, and Load Balancers.'),
(133, 'CVBGDDQZ', 'In a DDoS attack what role do botnets typically play?', 'They serve as the target of the attack.', 'They provide the resources to launch the attack.', 'They defend against the attack.', 'They analyze the attack traffic.', 'B', 'In a DDoS attack, botnets provide the resources to launch the attack by generating a large volume of traffic.'),
(134, 'CVBGDDQZ', 'Which layer of the OSI model is often targeted by DDoS attacks?', 'Application layer', 'Transport layer', 'Network layer', 'Physical layer', 'C', 'DDoS attacks often target the Network layer of the OSI model to overwhelm network bandwidth.'),
(135, 'CVBGDDQZ', 'Which of the following statements about DoS and DDoS attacks is true?', 'DoS attacks are easier to detect than DDoS attacks.', 'DDoS attacks typically involve a coordinated effort from multiple attackers.', 'DoS attacks are more sophisticated than DDoS attacks.', 'DDoS attacks are only carried out by nation-states.', 'B', 'DDoS attacks typically involve a coordinated effort from multiple attackers, making them harder to detect and mitigate.'),
(136, 'CVBGDDQZ', 'What is the main difference between a DoS attack and a DDoS attack?', 'DoS attacks are illegal while DDoS attacks are legal.', 'DoS attacks are easier to launch than DDoS attacks.', 'DoS attacks target individual users while DDoS attacks target network infrastructure.', 'DoS attacks typically involve a single source while DDoS attacks involve multiple sources.', 'D', 'DoS attacks typically involve a single source while DDoS attacks involve multiple sources, making DDoS more complex and powerful.');
INSERT INTO `questions` (`id`, `quiz_id`, `question_text`, `option_a`, `option_b`, `option_c`, `option_d`, `correct_option`, `explanation`) VALUES
(137, 'CVBGDDQZ', 'Which of the following is a characteristic of a DDoS attack?', 'It is always carried out by a single attacker.', 'It aims to gain unauthorized access to a system.', 'It often uses a botnet to generate a large volume of traffic.', 'It primarily targets software vulnerabilities.', 'C', 'A DDoS attack often uses a botnet to generate a large volume of traffic, overwhelming the target system.'),
(138, 'CVBGDDQZ', 'Which of the following is NOT a common type of DDoS attack?', 'DNS amplification', 'HTTP flooding', 'ARP poisoning', 'ICMP flood', 'C', 'ARP poisoning is not a common type of DDoS attack. Common types include DNS amplification, HTTP flooding, and ICMP flood.'),
(139, 'CVBGDDQZ', 'What is the purpose of a DoS or DDoS attack?', 'To gain administrative access to a system', 'To encrypt files and demand ransom', 'To prevent legitimate users from accessing a service', 'To spread malicious software', 'C', 'The purpose of a DoS or DDoS attack is to prevent legitimate users from accessing a service by overwhelming it with traffic.'),
(140, 'CVBGDDQZ', 'Which layer of the OSI model is typically targeted by DDoS attacks aimed at overwhelming network bandwidth?', 'Application layer', 'Transport layer', 'Network layer', 'Physical layer', 'C', 'DDoS attacks aimed at overwhelming network bandwidth typically target the Network layer of the OSI model.'),
(141, 'AIJMMAIN', 'What is the biggest challenge AI can help journalists with?', 'Writing novels', 'Fact-checking and audience engagement', 'Playing video games', 'Painting pictures', 'B', 'AI assists in verifying facts and improving audience engagement in journalism.'),
