(149, 'AIJMMAIN', 'Why is verifying images important in journalism?', 'Fake images spread faster than real news', 'It helps journalists get famous', 'It makes news more colorful', 'It helps sell more newspapers', 'A', 'Fake images spread faster than real news, making verification essential.'),
