(153, 'AIJMMAIN', 'How does Synthesia help in news production?', 'By generating AI-powered video anchors', 'By creating paper newspapers', 'By taking photographs', 'By drawing cartoons', 'A', 'Synthesia generates AI-powered video anchors for automated news production.'),
(154, 'AIJMMAIN', 'What does Wordtune help with?', 'Improving writing clarity', 'Cleaning floors', 'Playing music', 'Sending faxes', 'A', 'Wordtune enhances writing clarity and readability for journalists.'),
