(156, 'AIJMMAIN', 'What is Hootsuite used for?', 'Social media scheduling', 'Writing books', 'Watching movies', 'Playing video games', 'A', 'Hootsuite helps journalists schedule social media posts efficiently.'),
(157, 'AIJMMAIN', 'What can AI do in storytelling?', 'Generate real-time translations', 'Create fictional characters', 'Build robots', 'Repair televisions', 'A', 'AI assists in real-time language translations for global communication.'),
(158, 'AIJMMAIN', 'How can AI help investigative journalism?', 'By analyzing large datasets', 'By painting murals', 'Making music', 'Delivering newspapers', 'A', 'AI helps analyze large datasets for investigative journalism.'),
(159, 'AIJMMAIN', 'What is AR & VR used for in media?', 'Enhancing storytelling with immersive visuals', 'Making phone calls', 'Writing legal documents', 'Driving cars', 'A', 'AR & VR enhance storytelling with immersive visuals.'),
(160, 'AIJMMAIN', 'What is a key ethical concern with AI in journalism?', 'Bias in AI-generated content', 'AIs ability to make people dance', 'AIs skill in playing chess', 'AIs love for music', 'A', 'Bias in AI-generated content can influence journalism ethics.'),
(161, 'AIJMMAIN', 'Why should journalists be cautious about AI-generated news?', 'It may contain misinformation', 'AI cannot type', 'AI does not understand colors', 'AI can only cook food', 'A', 'AI-generated news may contain misinformation and should be fact-checked.'),
(162, 'AIJMMAIN', 'What is one way AI can improve news quality?', 'By detecting and removing fake news', 'By adding fake news', 'By deleting news websites', 'By creating new social media platforms', 'A', 'AI can detect and remove fake news to improve news quality.'),
(163, 'AIJMMAIN', 'What is the future of AI in journalism?', 'It will continue evolving with new advancements', 'It will stop working', 'It will replace all journalists', 'It will only work in movies', 'A', 'AI in journalism will continue evolving with new advancements.'),
(164, 'AIJMMAIN', 'Why is AI ethics important in journalism?', 'To ensure fairness and accuracy in news', 'To spread misinformation faster', 'To prevent journalists from working', 'To create more biased articles', 'A', 'AI ethics ensure fairness and accuracy in news reporting.'),
