(167, 'AIHDMAIN', 'Which AI tool allows you to execute Python code in a collaborative environment?', 'Google Colab', 'ChatGPT', 'Poe AI', 'Buffer', 'A', 'Google Colab is a cloud-based platform for writing and executing Python code collaboratively.'),
(168, 'AIHDMAIN', 'Which of the following tools offers access to multiple AI models like Claude and GPT?', 'Poe AI', 'Canva', 'Resumatch.io', 'ClickUp', 'A', 'Poe AI allows users to interact with various AI models such as ChatGPT, Claude, and others.'),
