(178, 'AIHDMAIN', 'Which tool is most appropriate for creating HR infographics?', 'Quadratic', 'ClickUp', 'Canva', 'Perplexity AI', 'C', 'Canva helps create professional-quality infographics and visual content.'),
(179, 'AIHDMAIN', 'Quadratic AI combines spreadsheet interface with:', 'Project tracking', 'AI prompting for data tasks', 'Image editing', 'PDF creation', 'B', 'Quadratic AI enables users to prompt AI directly within a spreadsheet-like interface.'),
(180, 'AIHDMAIN', 'Which of the following is used for interactive brainstorming sessions?', 'Miro', 'Resumatch.io', 'Buffer', 'Poe AI', 'A', 'Miro is widely used for visual collaboration and brainstorming.'),
(181, 'AIHDMAIN', 'Which tool helps transcribe audio to text for meeting documentation?', 'Otter AI', 'Google Colab', 'Visily', 'SkillSyncer', 'A', 'Otter AI transcribes conversations and meetings into text.'),
