INSERT INTO `recorded_video_master` (`id`, `videoId`, `course_id`, `batch_unique_id`, `session_no`, `date_of_session`, `video_description`, `video_url`, `subtitle_url`, `video_summary`, `session_handled_by`, `createdBy`, `approved`, `approvedDate`) VALUES
(1, 'vMVkUKmsPc3nQy5W', 'AIJM', 'AIJMB0001', 1, '2025-02-07', 'Session 1: Introduction to ChatGPT, Google Fact Checker', 'https://cybervaultit.learnlike.in/AI-Journalism/dashboard/assets/videos/recorded_videos/07-02-2025/index.m3u8', NULL, '<h1>Meeting Summary: AI Training Program (02/07/2025)</h1>\n\n    <h2>Quick Recap</h2>\n    <p>The meeting introduced the <span class=\"highlight\">Cyber World Innovations</span> team, a Singapore-based startup specializing in cybersecurity and AI solutions. Discussions revolved around the role of AI in journalism, with a deep dive into tools like ChatGPT and their responsible use, particularly in fact-checking. The session also highlighted challenges associated with AI, including cybersecurity threats, ethical concerns, and the need for regulatory measures to prevent misuse.</p>\n\n    <h2>Next Steps</h2>\n    <ul>\n        <li><span class=\"highlight\">Deepak</span> to share AI tools and resources via a dashboard, accessible next week.</li>\n        <li>Participants will receive login credentials for the dashboard containing session details, sample prompts, recorded videos, and course completion certificates.</li>\n        <li>The same session link will be used for the next meeting.</li>\n        <li>Participants should prepare questions or discussion topics for the next session.</li>\n        <li>Universities and UGC to explore guidelines for AI use in academic research and assignments.</li>\n        <li>Participants are advised to avoid sharing personal information when using AI tools like ChatGPT.</li>\n        <li><span class=\"highlight\">Cyber Vault</span> (Rajbabu\'s company) will continue efforts in training new cybersecurity specialists to combat cybercrime.</li>\n    </ul>\n\n    <h2>Cyber World Innovations Training Programs</h2>\n    <p>Rajbabu, CEO and co-founder of <span class=\"highlight\">Cyber World Innovations</span>, introduced his team and expressed gratitude to the News Writers team for the opportunity to present their training programs. He requested participants to mute themselves to minimize disruptions. <span class=\"highlight\">Deepak</span>, the head of training, led the session, attended by participants from various locations, including India.</p>\n\n    <h2>Exploring AI Tools in Journalism</h2>\n    <p>The session covered interactive AI tools and chatbots used in journalism. Deepak engaged participants in discussions about their perceptions of AI in their work. <span class=\"highlight\">Sadhana</span> shared her experience with ChatGPT for research and fact-checking. Deepak emphasized responsible AI use, fact-checking, and verification, highlighting ChatGPTs leadership in AI research.</p>\n\n    <h2>Industrial Revolutions and AI Evolution</h2>\n    <p>Deepak traced the evolution of industrial revolutions:</p>\n    <ul>\n        <li><strong>First:</strong> Mechanized printing</li>\n        <li><strong>Second:</strong> Mass production, telegraph, and radio</li>\n        <li><strong>Third:</strong> Digital era (internet, 24/7 news)</li>\n        <li><strong>Fourth:</strong> AI-driven technologies, IoT, robotics, 3D printing, and quantum computing</li>\n    </ul>\n    <p>He highlighted the rise of generative AI and its potential to create human-like responses, raising concerns about its deceptive capabilities.</p>\n\n    <h2>Exploring Artificial Intelligence and Generative AI</h2>\n    <p>Deepak explained AI concepts, including machine learning (supervised & unsupervised), deep learning, and generative AI. He demonstrated generative AIs applications in text, image, and video generation while cautioning against its misuse (e.g., deepfakes). <span class=\"highlight\">Kishor</span> shared his experience with a video generation app, noting its repetitive nature.</p>\n\n    <h2>AI Applications and Challenges in Journalism</h2>\n    <p>The discussion covered AIs role in journalism, including information gathering, cost reduction, and content production, as well as challenges like originality, creativity, and ethical concerns.</p>\n\n    <h2>ChatGPT System Features and Capabilities</h2>\n    <p>Deepak demonstrated ChatGPTs features:</p>\n    <ul>\n        <li>Content generation (text, images, charts)</li>\n        <li>Multi-language support</li>\n        <li>Integration with LinkedIn, GitHub, Twitter</li>\n        <li>Security features (multi-factor authentication, logout from all devices)</li>\n    </ul>\n\n    <h2>Generating Story Ideas and Summaries</h2>\n    <p>Deepak demonstrated AI-powered story idea generation for politics, sports, and business. <span class=\"highlight\">Dr. Ashish</span> asked about AI research tools, and Deepak provided insights.</p>\n\n    <h2>ChatGPT for Translation and Article Creation</h2>\n    <p>The session covered translation, grammar checking, article creation, and bias detection in AI-generated content. <span class=\"highlight\">Shambhu</span> raised concerns about AI bias, which Deepak addressed.</p>\n\n    <h2>ChatGPT Capabilities and Limitations</h2>\n    <p>Participants raised concerns about:</p>\n    <ul>\n        <li><strong>Data privacy:</strong> Sonia questioned privacy issues, which Deepak clarified.</li>\n        <li><strong>Usage limits:</strong> Free versions have limitations on image and file generation.</li>\n    </ul>\n\n    <h2>ChatGPT, Plagiarism, and Image Creation</h2>\n    <p>Deepak explained plagiarism detection and recommended tools like <span class=\"highlight\">Undetectable.ai</span>. <span class=\"highlight\">Utsav</span> mentioned university restrictions on AI-generated content. Deepak demonstrated Microsoft Co-Pilot for image creation, which offers more credits than ChatGPT.</p>\n\n    <h2>Image and Video Verification Tools</h2>\n    <p>Deepak showcased tools for detecting tampered images and deepfake videos, including Googles fact-checking tool, Google Lens, and Fake Image Detector.</p>\n\n    <h2>Addressing Cyber Crimes and AI Tools</h2>\n    <p>Deepak and Rajbabu discussed AI-related cyber threats, citing financial losses exceeding $8 trillion globally. They emphasized the shortage of cybersecurity specialists and the need for more public awareness and training.</p>\n\n    <h2>AI Tool Usage and Precautions</h2>\n    <p>Deepak advised against sharing personal information in AI tools. <span class=\"highlight\">Dr. Ashish</span> requested research-based AI tools, which will be covered in the next session. <span class=\"highlight\">Dhara</span> noted that some journals restrict AI use to 10-25%, which Deepak confirmed.</p>\n\n    <h2>Conclusion</h2>\n    <p>The recorded session and course completion certificates will be available on the dashboard next week. The next session will use the same link.</p>\n', 'Mr. Deepak Ravikumar, Mr. Thiyagarajan Palanisamy', '100000', 1, '2025-02-12 12:38:24'),
(2, 'JFLdREbXUKSY3Cf2', 'AIJM', 'AIJMB0001', 2, '2025-02-08', 'Session 2: Datawrapper, Power BI and Canva AI', 'https://cybervaultit.learnlike.in/AI-Journalism/dashboard/assets/videos/recorded_videos/08-02-2025/index.m3u8', NULL, ' <h1>Meeting Summary for AI Training Program (02/08/2025)</h1>\n\n    <h2>Quick Recap</h2>\n    <p>The meeting focused on training media professionals to use various AI tools and data visualization software. Participants learned about ChatGPT\'s capabilities for data analysis and content creation, as well as Microsoft Office features for automation and accessibility. The session also covered data visualization tools like Data Wrapper, Power BI, and Canva, demonstrating their applications in creating interactive charts, maps, logos, and portfolio websites.</p>\n\n    <h2>Next Steps</h2>\n    <ul>\n        <li>Explore and practice using ChatGPT, Data Wrapper, and Canva tools demonstrated in the session.</li>\n        <li>Try creating data visualizations and charts using Data Wrapper with sample or real data.</li>\n        <li>Attempt to create a portfolio website using Canva and share any issues faced.</li>\n        <li>Download and explore Power BI desktop version for more advanced data analysis.</li>\n        <li>Provide feedback on the session and suggest topics for future workshops on data analysis and AI tools.</li>\n    </ul>\n\n    <h2>Summary</h2>\n\n    <h3>AI Tools Training for Media Professionals</h3>\n    <p>In the meeting, Rajbabu and Deepak led a training session for media professionals on AI tools. They established session rules, including muting all participants, writing down questions for a Q&A, and testing tools on their laptops. Deepak demonstrated ChatGPT\'s customization options and warned against behaviors that could skew results. The session was part of a two-day training.</p>\n\n    <h3>ChatGPT as a Data Analysis Tool</h3>\n    <p>Deepak demonstrated how ChatGPT can create and analyze datasets, generate graphs, and differentiate between data scientists and analysts. He showcased ChatGPT\'s ability to generate sample data and graphs, such as cancer statistics and gold price predictions, emphasizing its use for journalists in creating infographics.</p>\n\n    <h3>Digitizing Handwritten Notes with ChatGPT</h3>\n    <p>Sonia Chopra inquired about digitizing handwritten notes using ChatGPT. Deepak confirmed its feasibility and suggested alternatives like Google Lens for text capture. He also demonstrated Microsoft Office\'s automation features, though there were some technical issues with the audio and video feed.</p>\n\n    <h3>Exploring Microsoft AI Tools and Features</h3>\n    <p>Deepak discussed Microsoft\'s AI tools, including the immersive reader in Word, which assists non-native English speakers by highlighting parts of speech and adjusting reading pace. He also introduced translation and transcription tools, noting that transcription is a paid feature. Concerns about accent recognition were addressed, confirming compatibility with Indian accents.</p>\n\n    <h3>Exploring ChatGPT and Data Wrapper</h3>\n    <p>Deepak introduced ChatGPT for drafting proposals and official letters. Tiagraj then explained Data Wrappers role in creating visual representations of data, demonstrating its free features and optional paid upgrades. Sample data was provided for hands-on practice.</p>\n\n    <h3>Uploading Excel Data to Visualization Tools</h3>\n    <p>Thiyagu demonstrated how to upload Excel data into a visualization tool, explaining automatic data recognition, formatting options, and accessibility features. He also showed how to add annotations, customize charts, and embed them into websites.</p>\n\n    <h3>Interactive Chart Tool Demonstration</h3>\n    <p>Thiyagu showcased an interactive chart tool, explaining its premium features such as downloads, sharing, and embedding options. He demonstrated publishing within the Data Wrapper community and embedding charts using HTML.</p>\n\n    <h3>Data Visualization with Power BI</h3>\n    <p>Thiyagu demonstrated Power BIs capabilities for creating interactive charts and predictive models. Deepak and Rajbabu raised questions about visualization accuracy and interactivity, which Thiyagu addressed. He highlighted Power BIs ability to analyze detailed data and forecast trends.</p>\n\n    <h3>Canva, ChatGPT, and Power BI Usage</h3>\n    <p>Thiyagu discussed Canvas role in digital content creation, including logos and posters. He demonstrated ChatGPTs application in generating content ideas and explained Power BIs advanced data visualization features. Sangeeta asked about Power BIs data size limits and cost, confirming that it\'s free for basic use.</p>\n\n    <h3>Creating Logos and Magazine Covers</h3>\n    <p>Thiyagu demonstrated how to create logos and magazine covers using Canva and Brand Cloud. He explained keyword-based design suggestions and the ability to upload personal images. Vijay inquired about personal image uploads, which Thiyagu confirmed.</p>\n\n    <h3>Creating Portfolio Websites with Canva</h3>\n    <p>Thiyagu guided participants in creating portfolio websites using Canva, clarifying that these are static sites with no backend. Deepak emphasized customization options for personal branding. The team also discussed video integration and potential limitations.</p>\n\n    <p>The meeting concluded with a group photo request from Rajbabu.</p>', 'Mr. Deepak Ravikumar, Mr. Thiyagarajan Palanisamy', '100000', 1, '2025-02-12 12:39:29'),
(3, 'VA74GGwCwWnr342N', 'AIJM', 'AIJMB0001', 3, '2025-02-09', 'Session 3: Pictory AI, Word Tune, Otter AI, Headline Studio', 'https://cybervaultit.learnlike.in/AI-Journalism/dashboard/assets/videos/recorded_videos/09-02-2025/index.m3u8', NULL, '<h1>Meeting Summary for AI Training Program (02/09/2025)</h1>\n    \n    <h2>Quick Recap</h2>\n    <p>The team discussed the progress of their AI program, focusing on creating personalized chat GPT personas, data wrappers, and logos using Canva. They also explored various tools for content creation, including Chat GPT, Pictory, Descript, Synthesia, Headline Studio, Hootsuite, and Google Analytics, with a focus on their potential applications in journalism. The conversation ended with discussions on the success of their recent session, plans for future sessions, and the possibility of offering training on Microsoft tools.</p>\n    \n    <h2>Next Steps</h2>\n    <ul>\n        <li>Deepak to share links for translation tools with participants.</li>\n        <li>Thiyagu to share directory of AI tools website link with participants.</li>\n        <li>Raj to upload certificates to the portal by Friday.</li>\n        <li>Raj to email certificates directly to participants.</li>\n        <li>Subhash to send corrected participant name list to Raj\'s team.</li>\n        <li>Deepak to email Subhash suggestions for future courses on Microsoft tools, including course topics and durations.</li>\n        <li>Raj\'s team to prepare and issue certificates after verifying names.</li>\n        <li>Raj\'s team to release assignments for participants in the next 2-3 days.</li>\n        <li>Raj\'s team to discuss internally and propose plans for future shorter workshops targeting the same participant group.</li>\n    </ul>\n    \n    <h2>Summary</h2>\n    \n    <h3>AI Program Progress and Personalization</h3>\n    <p>Rajbabu and Subhash discussed the progress of the AI program, with Rajbabu summarizing the previous day\'s topics, including creating personalized chat GPT personas, data wrappers, and logos using Canva. Deepak led the current session, demonstrating how AI can be utilized effectively.</p>\n    \n    <h3>Creating Portfolio Websites With AI</h3>\n    <p>Deepak demonstrated how to create a portfolio website using HTML, CSS, and JavaScript with Chat GPT\'s assistance. He explained the importance of using Creative Commons licensed images to avoid copyright infringement.</p>\n    \n    <h3>Chat GPT Portfolio Creation Tutorial</h3>\n    <p>Deepak showed how to create a portfolio using Chat GPT, adding images, contact buttons, and generating graphs using Python. He suggested using Microsoft Copilot for image generation.</p>\n    \n    <h3>Exploring Pictory and Video Transcription Tools</h3>\n    <p>Deepak introduced Pictory, a tool for converting scripts into videos. Thiyagu demonstrated Sauto.ai for transcribing audio from videos.</p>\n    \n    <h3>Zoom\'s AI Features and Video Creation</h3>\n    <p>Thiyagu explained Zoom\'s AI features, including meeting recordings and AI-powered video creation with Descript.</p>\n    \n    <h3>Exploring Chat GPT and Synthesia</h3>\n    <p>Thiyagu demonstrated Synthesia for AI-generated videos and introduced Headline Studio for SEO-optimized headlines.</p>\n    \n    <h3>Exploring Social Media Marketing Tools</h3>\n    <p>Deepak discussed social media marketing tools like Hootsuite and Hootsu. Thiyagu introduced Word Tune and Grammarly for content creation.</p>\n    \n    <h3>Google Analytics, Music Tools, Hootsuite, Translators</h3>\n    <p>Thiyagu explained Google Analytics, Deepak discussed Hootsuite, and translator tools for real-time language translation.</p>\n    \n    <h3>Cyber Security Training and Tools</h3>\n    <p>Sandip expressed interest in cyber security, and Deepak suggested basic courses. They also discussed training on Microsoft tools.</p>\n    \n    <h3>Planning Future Sessions and Certificates</h3>\n    <p>The team discussed the success of their session, certificate distribution, and plans for future workshops with possible fees.</p>', 'Mr. Deepak Ravikumar, Mr. Thiyagarajan Palanisamy', '100000', 1, '2025-02-12 12:49:50'),
