(8, 'nMb3PkZxCv7LjY6E', 'AIHD', 'AIHD0001', 5, '2025-05-09', 'Session 5: Quadratic AI, Canva + Buffer, Google AI Studio, Resumematch.io, Skillsyncer and other tools', 'https://cybervaultit.learnlike.in/LMS/dashboard/assets/videos/recorded_videos/unison/09-05-2025/index.m3u8', NULL, '', 'Mr. Deepak Ravikumar, Mr. Thiyagarajan Palanisamy and Mr. Rajbabu Gunaseelan', '100000', 1, '2025-05-25 20:23:27');
