(1, 'MSTE', 'Microsoft Office 365', '<svg xmlns=\"http://www.w3.org/2000/svg\" class=\"side-menu__icon\" enable-background=\"new 0 0 50 50\" viewBox=\"0 0 50 50\"><path d=\"M 31.546875 2 A 1.0001 1.0001 0 0 0 31.263672 2.0546875 L 5.6738281 10.853516 A 1.0001 1.0001 0 0 0 5 11.800781 L 5 38.199219 A 1.0001 1.0001 0 0 0 5.0058594 38.298828 A 1.0001 1.0001 0 0 0 5.0058594 38.300781 A 1.0001 1.0001 0 0 0 5.0449219 38.494141 A 1.0001 1.0001 0 0 0 5.0449219 38.496094 A 1.0001 1.0001 0 0 0 5.1230469 38.679688 A 1.0001 1.0001 0 0 0 5.3027344 38.916016 A 1.0001 1.0001 0 0 0 5.3789062 38.982422 A 1.0001 1.0001 0 0 0 5.546875 39.091797 A 1.0001 1.0001 0 0 0 5.6367188 39.132812 A 1.0001 1.0001 0 0 0 5.6386719 39.132812 A 1.0001 1.0001 0 0 0 5.6738281 39.146484 L 31.263672 47.945312 A 1.0001 1.0001 0 0 0 31.845703 47.966797 L 44.257812 44.666016 A 1.0001 1.0001 0 0 0 45 43.699219 L 45 6.3007812 A 1.0001 1.0001 0 0 0 44.257812 5.3339844 L 31.845703 2.0332031 A 1.0001 1.0001 0 0 0 31.546875 2 z M 31.625 4.0449219 L 43 7.0683594 L 43 42.931641 L 31.625 45.955078 L 15.753906 40.496094 L 30.869141 42.492188 A 1.0001 1.0001 0 0 0 32 41.5 L 32 9.5996094 A 1.0001 1.0001 0 0 0 30.798828 8.6210938 L 14.798828 11.919922 A 1.0001 1.0001 0 0 0 14 12.900391 L 14 34.201172 L 7 36.769531 L 7 12.513672 L 31.625 4.0449219 z M 30 10.828125 L 30 40.359375 L 10.158203 37.740234 L 15.34375 35.839844 A 1.0001 1.0001 0 0 0 16 34.900391 L 16 13.714844 L 30 10.828125 z\"/></svg>', '<p>We are thrilled to welcome you to the upcoming two-day workshop on Microsoft Tools for Education - Office 365. Your participation in this event is highly appreciated, and we are confident that it will be a valuable opportunity for you to enhance your teaching practices and empower your students through the effective use of Office 365 tools.</p>\n\n<p>During these two days, we have curated a comprehensive program that will provide you with hands-on experience and in-depth knowledge of Office 365 applications and their application in the field of education. The workshop will be conducted by experienced educators and Microsoft-certified trainers who will guide you through various sessions, demonstrations, and collaborative activities. </p>\n\n<p >Through this workshop, you will explore the potential of Office 365 tools such as Microsoft Teams, OneNote, Word, Excel, PowerPoint, and more. We will focus on leveraging these applications to facilitate communication, collaboration, content creation, and assessment in the classroom. You will learn practical strategies, best practices, and innovative ways to integrate these tools into your teaching methodologies, enabling you to create engaging and interactive learning experiences for your students. </p>\n\n<p >The workshop will cover a range of topics including: </p>\n<ol >\n<li>Effective communication and collaboration using Microsoft Teams.</li>\n<li>Creating and organizing digital content with OneNote. </li>\n<li>Harnessing the power of Word, Excel, and PowerPoint for educational purposes. </li>\n<li>Streamlining assignments, assessments, and grading with Office 365. </li>\n<li> Exploring data analysis tools for student progress tracking and personalized learning. </li>	\n</ol >\n<p >We encourage you to bring your laptop or tablet to actively participate in the hands-on activities. It would be helpful if you have access to an Office 365 account during the workshop. If you do not have one, we will assist you in creating a temporary account for the duration of the workshop. </p>\n\n<p >We are confident that this workshop will equip you with the necessary skills and knowledge to transform your teaching practices and create a dynamic learning environment for your students. We also believe that it will be an excellent opportunity for networking and collaboration with other passionate educators who share a common goal of leveraging technology for educational advancement. </p>\n\n<p >Thank you once again for joining us in this workshop. We are excited to have you on board and look forward to an inspiring and enriching two days of learning and growth. </p>\n\n<p >If you have any further questions or require any assistance, please do not hesitate to reach out to our dedicated support team. We are here to ensure that your workshop experience is outstanding. </p>\n', 1, '100000', '2023-05-31 13:18:41'),
