0.567-0.217c0.221-0.095,0.436-0.202,0.651-0.314    c0.141-0.074,0.278-0.154,0.415-0.234c0.175-0.102,0.358-0.185,0.528-0.298l113.268-75.537    c19.512-13.013,31.161-34.783,31.161-58.238V102.098C405.998,97.896,403.37,94.142,399.423,92.703z M246.001,439.263    l-97.732-65.155c-13.942-9.289-22.264-24.839-22.264-41.598v-86.516h119.996V439.263z M385.997,332.501    c0,16.754-8.321,32.304-22.258,41.599L266,439.281V245.993h119.997V332.501z M385.997,225.994H266V65.375l119.997,43.722V225.994z    \"/></g></g><g/><g/><g/><g/><g/><g/><g/><g/><g/><g/><g/><g/><g/><g/><g/></svg>', '<p>We are delighted to extend a warm welcome to you for the upcoming 45-hour intensive cybersecurity course. Your commitment to participating in this course is greatly appreciated, and we are confident that it will prove invaluable in enhancing your understanding and proficiency in the field of cybersecurity.\n</p>\n<p>\nOver the duration of this comprehensive course, we have meticulously designed a curriculum that will immerse you in various aspects of cybersecurity, providing hands-on experience and in-depth knowledge essential for navigating the intricacies of modern digital security challenges.\n</p><p>\nLed by seasoned cybersecurity professionals and certified trainers, this course will feature a series of interactive sessions, practical demonstrations, and collaborative exercises aimed at equipping you with the requisite skills and expertise to effectively address cybersecurity threats and safeguard digital assets.\n</p><p>\nThroughout the course, you will delve into a wide range of topics, including:\n</p>\n<ol><li>Fundamentals of Cybersecurity: \nUnderstanding the core concepts and principles of cybersecurity.</li>\n<li>Threat Landscape Analysis: Identifying and analyzing prevalent cyber threats and vulnerabilities.</li>\n<li>Secure Network Architecture: Implementing robust network security measures to mitigate risks.</li>\n<li>Data Protection Strategies: Safeguarding sensitive information through encryption and access control mechanisms.</li>\n<li>Incident Response and Recovery: Developing strategies to detect, respond to, and recover from cybersecurity incidents.</li></ol><p>\nWe encourage you to actively participate in the course activities and exercises using your own laptop or tablet. Access to relevant cybersecurity tools and resources will be provided, ensuring a hands-on learning experience.\n</p><p>\nAt the conclusion of the course, you will emerge equipped with the knowledge, skills, and confidence to tackle real-world cybersecurity challenges effectively. Additionally, you will have the opportunity to connect and collaborate with fellow cybersecurity enthusiasts, fostering a supportive community dedicated to continuous learning and professional growth.\n</p><p>\nOnce again, thank you for choosing to embark on this cybersecurity journey with us. We are excited to embark on this learning adventure together and remain committed to providing you with exceptional support throughout the course. Should you have any questions or require assistance, please don\'t hesitate to reach out to our dedicated support team.\n</p><p>\nHere\'s to a fulfilling and enriching experience ahead!</p>', 1, '100000', '2024-05-12 00:47:18'),
(6, 'AIJM', 'AI for Media Professionals', '<svg xmlns=\"http://www.w3.org/2000/svg\"  class=\"side-menu__icon\" enable-background=\"new 0 0 50 50\" viewBox=\"0 0 50 50\"><path d=\"M5,5v40h40V5H5z M25.399,28.028l-2.522,4.611c-0.19,0.347-0.534,0.52-0.877,0.52s-0.688-0.173-0.877-0.52l-2.522-4.611 c-0.551-1.007-1.378-1.835-2.385-2.385l-4.611-2.522c-0.694-0.379-0.694-1.375,0-1.755l4.611-2.522 c1.007-0.551,1.834-1.378,2.385-2.385l2.522-4.611c0.19-0.347,0.534-0.52,0.877-0.52s0.688,0.173,0.877,0.52l2.522,4.611 c0.551,1.007,1.378,1.834,2.385,2.385l4.611,2.522c0.694,0.379,0.694,1.375,0,1.755l-4.611,2.522 C26.778,26.193,25.95,27.021,25.399,28.028z M39.157,35.289l-2.244,1.227c-0.167,0.093-0.305,0.23-0.397,0.398l-1.228,2.244 c-0.21,0.386-0.613,0.625-1.053,0.625c-0.001,0-0.002,0-0.003,0c-0.44-0.001-0.844-0.242-1.053-0.631l-1.225-2.238 c-0.093-0.169-0.23-0.307-0.397-0.397l-2.245-1.229c-0.387-0.212-0.626-0.616-0.625-1.056c0.002-0.439,0.242-0.842,0.628-1.051 l2.241-1.227c0.169-0.093,0.306-0.229,0.397-0.397l1.229-2.246c0.207-0.382,0.609-0.622,1.049-0.624c0.001,0,0.002,0,0.003,0 c0.438,0,0.841,0.239,1.053,0.623v0.002l1.228,2.245c0.092,0.167,0.229,0.305,0.398,0.397l2.245,1.229 c0.382,0.205,0.623,0.608,0.624,1.049S39.545,35.078,39.157,35.289z\"/></svg>', '<p>We are delighted to extend a warm welcome to you for the upcoming 3-day (6-hour) intensive course on <strong>Artificial Intelligence (AI) for Media Professionals</strong>. Your commitment to participating in this course is greatly appreciated, and we are confident that it will prove invaluable in enhancing your understanding and proficiency in AI-driven tools for media and journalism.</p>\n\n<p>\nOver the duration of this comprehensive course, we have meticulously designed a curriculum that will immerse you in various AI tools revolutionizing the media industry. You will gain hands-on experience and in-depth knowledge essential for leveraging AI to enhance content creation, fact-checking, data visualization, and overall media efficiency.\n</p>\n\n<p>\nLed by seasoned AI experts and industry professionals, this course will feature interactive sessions, practical demonstrations, and collaborative exercises aimed at equipping you with the requisite skills to integrate AI tools into your media workflows.\n</p>\n\n<p>\nThroughout the course, you will explore a wide range of AI-powered tools, including:\n</p>\n\n<ol>\n<li><strong>ChatGPT:</strong> Enhancing content generation and automating writing tasks.</li>\n<li><strong>Google Fact Checker:</strong> Verifying news accuracy and combating misinformation.</li>\n<li><strong>Datawrapper:</strong> Creating visually appealing and accurate data visualizations.</li>\n<li><strong>Canva AI:</strong> Designing AI-powered graphics and multimedia content.</li>\n<li><strong>Pictory AI:</strong> Generating AI-assisted video content.</li>\n<li><strong>Otter AI:</strong> Transcribing audio and meetings with AI-driven accuracy.</li>\n<li><strong>Wordtune:</strong> Refining and improving writing style using AI suggestions.</li>\n<li><strong>Headline Studio:</strong> Crafting compelling and high-impact headlines using AI insights.</li>\n<li><strong>Other AI Tools:</strong> Exploring additional AI solutions that enhance media and journalism efficiency.</li>\n</ol>\n\n<p>\nWe encourage you to actively participate in the course activities and exercises using your own laptop or tablet. Access to relevant AI tools and resources will be provided, ensuring a hands-on learning experience.\n</p>\n\n<p>\nAt the conclusion of the course, you will emerge equipped with the knowledge, skills, and confidence to integrate AI into your media workflows effectively. Additionally, you will have the opportunity to connect and collaborate with fellow media professionals, fostering a network dedicated to innovation and growth in AI-driven journalism.\n</p>\n\n<p>\nOnce again, thank you for choosing to embark on this AI journey with us. We are excited to explore the future of AI in media together and remain committed to providing you with exceptional support throughout the course. Should you have any questions or require assistance, please don\'t hesitate to reach out to our dedicated support team.\n</p>\n\n<p>\nHere\'s to a fulfilling and enriching experience ahead!\n</p>\n', 1, '100000', '2025-02-11 19:08:26'),
(7, 'AIHD', 'AI for HR & Delivery Mgr', '<svg xmlns=\"http://www.w3.org/2000/svg\"  class=\"side-menu__icon\" enable-background=\"new 0 0 50 50\" viewBox=\"0 0 50 50\"><path d=\"M5,5v40h40V5H5z M25.399,28.028l-2.522,4.611c-0.19,0.347-0.534,0.52-0.877,0.52s-0.688-0.173-0.877-0.52l-2.522-4.611 c-0.551-1.007-1.378-1.835-2.385-2.385l-4.611-2.522c-0.694-0.379-0.694-1.375,0-1.755l4.611-2.522 c1.007-0.551,1.834-1.378,2.385-2.385l2.522-4.611c0.19-0.347,0.534-0.52,0.877-0.52s0.688,0.173,0.877,0.52l2.522,4.611 c0.551,1.007,1.378,1.834,2.385,2.385l4.611,2.522c0.694,0.379,0.694,1.375,0,1.755l-4.611,2.522 C26.778,26.193,25.95,27.021,25.399,28.028z M39.157,35.289l-2.244,1.227c-0.167,0.093-0.305,0.23-0.397,0.398l-1.228,2.244 c-0.21,0.386-0.613,0.625-1.053,0.625c-0.001,0-0.002,0-0.003,0c-0.44-0.001-0.844-0.242-1.053-0.631l-1.225-2.238 c-0.093-0.169-0.23-0.307-0.397-0.397l-2.245-1.229c-0.387-0.212-0.626-0.616-0.625-1.056c0.002-0.439,0.242-0.842,0.628-1.051 l2.241-1.227c0.169-0.093,0.306-0.229,0.397-0.397l1.229-2.246c0.207-0.382,0.609-0.622,1.049-0.624c0.001,0,0.002,0,0.003,0 c0.438,0,0.841,0.239,1.053,0.623v0.002l1.228,2.245c0.092,0.167,0.229,0.305,0.398,0.397l2.245,1.229 c0.382,0.205,0.623,0.608,0.624,1.049S39.545,35.078,39.157,35.289z\"/></svg>', '<p>\r\nWe are pleased to welcome you to the upcoming 5-day (12-hour) hands-on course on <strong>Artificial Intelligence (AI) for HR and Delivery Managers - Unison Consulting Pte. Ltd</strong>. Your participation in this specialized training demonstrates a forward-thinking mindset, and we are confident it will empower you with the practical AI knowledge needed to drive innovation in your teams and workflows.\r\n</p>\r\n\r\n<p>\r\nThis intensive program has been thoughtfully curated to help HR and delivery professionals harness the potential of cutting-edge AI tools. You\'ll engage with technologies that are revolutionizing workforce planning, recruitment, project delivery, team collaboration, and overall organizational efficiency.\r\n</p>\r\n\r\n<p>\r\nLed by AI practitioners and industry-aligned trainers, this course features interactive demonstrations, real-world case studies, and collaborative activities designed to equip you with immediately applicable skills.\r\n</p>\r\n\r\n<p>\r\nThroughout the course, you will gain exposure to a wide range of powerful, free AI tools including:\r\n</p>\r\n\r\n<ol>\r\n<li><strong>ChatGPT:</strong> Enhancing employee communication, generating reports, and automating routine tasks.</li>\r\n<li><strong>Perplexity AI:</strong> Conducting fast, accurate research for HR policies and delivery processes.</li>\r\n<li><strong>Poe AI:</strong> Accessing multiple AI models for comparison and problem-solving.</li>\r\n<li><strong>Google Colab:</strong> Collaborating on live Python notebooks for data analysis and automation.</li>\r\n<li><strong>Miro/Visily:</strong> Visualizing team structures, workflows, and planning activities.</li>\r\n<li><strong>ClickUp:</strong> Managing AI-assisted project workflows and performance tracking.</li>\r\n<li><strong>Datawrapper:</strong> Creating intuitive charts and graphs for HR analytics and project metrics.</li>\r\n<li><strong>Resumatch.io / SkillSyncer:</strong> Enhancing recruitment through AI-powered resume screening and job match scoring.</li>\r\n<li><strong>Google AI Studio:</strong> Exploring Google\'s advanced AI services and no-code tools for HR use cases.</li>\r\n<li><strong>Quadratic AI:</strong> Analyzing workforce or delivery data using spreadsheet-style AI prompts.</li>\r\n<li><strong>Canva + Buffer:</strong> Designing and scheduling internal HR campaigns or communication plans with AI help.</li>\r\n<li><strong>Text-to-Speech AI / Juicebox / Futurepedia:</strong> Exploring the latest AI innovations for learning, onboarding, and team engagement.</li>\r\n</ol>\r\n\r\n<p>\r\nTo make the most of this learning experience, we recommend bringing a laptop or tablet with internet access. All necessary access links and support resources will be provided to ensure a seamless hands-on journey.\r\n</p>\r\n\r\n<p>\r\nBy the end of this program, youll be equipped with AI tools and practical strategies to optimize HR operations, improve delivery performance, and lead AI integration within your functional domains. Youll also build meaningful connections with fellow managers committed to innovation and digital transformation.\r\n</p>\r\n\r\n<p>\r\nThank you once again for joining us on this transformative AI journey. We look forward to supporting you every step of the way. Should you have any queries or require technical assistance, our team is here to help.\r\n</p>\r\n\r\n<p>\r\nWishing you a productive and insightful experience!\r\n</p>\r\n', 1, '100000', '2025-05-19 18:50:51');
